/* ------------------------------------------------------------------ */
/* PageArray.jsx                                                      */
/* Author: John Hart                                                  */
/* ------------------------------------------------------------------ */

import React from "react";
import {DndProvider} from 'react-dnd';
import {HTML5Backend} from 'react-dnd-html5-backend';

import Square from './Square';
import Element from './Element';

function renderSquare(value, index) {
    const element = <Element value={value} />;
    return <div>
        <Square index={index}>{element}</Square>
    </div>
}

export default function PageArray() {
    return (
    <div style={{
        width: '100%',
        height: '100%',
        display: 'flex',
        flexWrap: 'wrap'
    }}
    >
        {renderSquare(4, 0)}
        {renderSquare(7, 1)}
        {renderSquare(5, 2)}
        {renderSquare(1, 3)}
        {renderSquare(8, 4)}
        {renderSquare(3, 5)}
        {renderSquare(2, 6)}
        {renderSquare(6, 7)}
    </div>
    );
    // return <DndProvider backend={HTML5Backend}></DndProvider>
}
